import React from "react";
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';




const Login = () => {
    return (
        <Box sx={{ flexGrow: 1 }}>
        <Grid container  justify = "center">
        <Grid item xs={12}>
            <div>
                <h1>Welcome!!</h1>
            </div>
        </Grid>

      </Grid>
    </Box>
    );
}

export default Login;
